import React from 'react';
import '../assets/styles/Footer.css'
import SocialMedia from './FooterComponent/SocialMedia';

const Footer = () => {
    return (
        <>
            <div className="row">
                <div className="container ">
                    <div className="Footer">
                        <h3>Social Media</h3>
                        <SocialMedia />

                    </div>
                </div>
            </div>
        </>
    );
};

export default Footer;
